angular.module("home/home.tpl.html", []).run(["$templateCache", function($templateCache) {
  $templateCache.put("home/home.tpl.html",
    "<div>\n" +
    "	<div class=\"row\">Displaying profiling results in text format.  Sort by: <span ng-repeat=\"(key, value) in sort_func\"><a ng-click=\"updateSort(key)\" class='btn btn-sm btn-info'>{{key}}</a> </span></div>\n" +
    "\n" +
    "	<div class=\"row\">\n" +
    "	<pagination page=\"currentPage\" total-items=\"entries.length\" items-per-page=\"numPerPage\" boundary-links=\"true\"></pagination>\n" +
    "	</div>\n" +
    "	<div class=\"row\">\n" +
    "		<ul class=\"list-group\">\n" +
    "			<li class=\"list-group-item\" ng-repeat=\"entry in pagedEntries\">\n" +
    "				<h4 class=\"list-group-item-heading\">{{entry.location}}</h4>\n" +
    "				<p class=\"list-group-item-text\">Called {{entry.count}} times and used {{entry.perf.cycles}} cycles</p>\n" +
    "				<p class=\"list-group-item-text\">Allocated {{entry.memory.malloc_count}} times.</p>\n" +
    "			</li>\n" +
    "		</ul>\n" +
    "	</div>\n" +
    "</div>\n" +
    "\n" +
    "");
}]);
